import { Layout, Menu } from "antd";
import "antd/dist/antd.css";
import { useState } from "react";
import {UserOutlined} from '@ant-design/icons';

const Navbar = () => {
  const [state, setstate] = useState({ keys: "" });

  const handleClick = (event) => {
      setstate({...state, key: event.key});
    console.log(event.key);
  };
  return (
    <Layout.Header>
      <Menu mode="horizontal" defaultSelectedKeys={["I1"]}>
        <Menu.Item
          key="I1"
          onClick={(event) => handleClick(event)}
        >
          Item 1
        </Menu.Item>

        <Menu.Item
          key="I2"
          onClick={(event) => console.log(event.key)}
        >
          Item 2
        </Menu.Item>
        <Menu.Item
          key="connexion"
          onClick={(event) => console.log(event.key)}
        >
          Connexion
          <UserOutlined/> Connexion
        </Menu.Item>
      </Menu>
    </Layout.Header>
  );
}
export default Navbar;
